html,
body {
  background-color: var(--g-colorGray0) !important;
  color: var(--color-text-dark) !important;
}

::selection {
  background-color: var(--g-colorRed100) !important;
  color: var(--color-text-dark) !important;
}

.BsF .xnr,
.BsF svg {
  color: var(--color-text-light) !important;
}

.xnr,
.erh,
.NAw {
  color: white !important;
}

[data-test-id=pin-builder-add-draft] svg,
[data-test-id=saved-info] + div button .xnr {
  color: var(--color-text-light) !important;
}

[data-test-id=pinrep-source-link],
[data-test-id=flashlight-button],
[data-test-id=persistent-one-click-save] [role=button] div {
  background-color: var(--g-colorGray0) !important;
}

[data-test-id=persistent-one-click-save] [role=button] > div > div:last-child {
  background-color: var(--g-colorRed100) !important;
}

[data-test-id=pinWrapper] > div:first-child[style*=box-shadow] {
  border: solid 4px var(--g-colorRed100) !important;
  box-shadow: none !important;
}

[data-test-id=pinWrapper] > div:first-child[style*=box-shadow] > div {
  background-color: var(--g-colorRed100) !important;
}

[data-test-id=SaveButton] .SaveButton__background--enabled,
[data-test-id=board-dropdown-save-button],
.SignupButton {
  background-color: var(--g-colorRed100) !important;
}

[data-test-id=SaveButton] *,
[data-test-id=board-dropdown-save-button] *,
.SignupButton * {
  color: var(--color-text-dark) !important;
}

select,
textarea,
input:not([type=search]) {
  background-color: var(--g-colorGray0) !important;
  color: var(--color-text-dark) !important;
  font-weight: bold !important;
}

textarea::placeholder,
input::placeholder {
  color: var(--color-text-dark) !important;
}

.JJV,
.prG {
  background-color: var(--g-colorTransparentWhite) !important;
}

.mainContainer > div > div {
  background-color: var(--g-colorGray0) !important;
}


#searchBoxContainer > div {
  background-color: var(--g-colorGray0) !important;
}
#searchBoxContainer > div input[name=searchBoxInput] {
  background-color: transparent !important;
}
#searchBoxContainer > div input[name=searchBoxInput]::selection {
  background-color: var(--color-text-dark) !important;
  color: var(--g-colorRed100) !important;
}
#searchBoxContainer > div > div[style*=box-shadow] {
  box-shadow: none !important;
  background-color: var(--g-colorRed100) !important;
}


